import React from 'react'
import styled from "styled-components";

const StyledInput = styled.input`
  width: 100%;
  height: 25px;
  margin-right: 10px;
  border-radius: 5px;
  border: none;
  padding: 10px;
  font-size: 15px;
`;
const SearchPanel = () => {
    return (
        <StyledInput type="text" placeholder='search'/>
    )
};

export default SearchPanel;
